Орден Австралії (англ. Order of Australia) — орден Австралії, запроваджений королевою Єлизаветою II 14 лютого 1975 року «з метою відповідного визнання громадян Австралії на інших осіб в їх досягненнях та добрій службі». Орден поділяється на громадський і воєнний. Існує 5 ступенів ордена в такому низхідному порядку: 
* Лицар або дама ордена (AK або AD; станом на 2021 рік не присуджується); 
* Кавалер ордена (AC — не більше 35 в рік); 
* Офіцер ордена (AO — не більше 140 в рік); 
* Член ордена (AM — не більше 605 в рік); 
* Медаль ордена Австралії (OAM — без обмежень).

